/*
 3. 이클립스를 이용하여 화면에 “1 2 3 4 5 6 7 8 9”를 출력하는 자바 프로그램을 작성하라. 
 작업 공간(workspace)은 C:\Temp로 하고, 프로젝트 이름은 1-3으로 한다. 
 클래스 이름은 One2Nine으로 한다.
 */
public class One2Nine {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i = 1; i<10; i++)
		{
			System.out.print(i);
			System.out.print(" ");
		}
	}

}
